import {
    IonBackButton,
    IonButtons,
    IonCol,
    IonContent,
    IonDatetime,
    IonGrid,
    IonHeader,
    IonItem,
    IonLabel,
    IonMenuButton,
    IonPage,
    IonRow,
    IonTitle,
    IonToolbar,
  } from "@ionic/react";
import React, { useState } from "react";

const Calendar: React.FC = () => {
  const [time, setTime] = useState(new Date().toISOString());
  const updateTime = (currentTime: any) => {
    const tempTime = new Date().toISOString();
    if(tempTime > currentTime){
      setTime(currentTime);
      console.log(currentTime);
    }else{
      setTime(tempTime);
      console.log('bruh');
    }
  };
    return(
      <IonPage>
      <IonHeader>
        <IonToolbar color="primary">
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>Calendar</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <IonGrid>
          <IonRow>
            <IonCol>
              <IonItem>
                <IonLabel>Date</IonLabel>
                <IonDatetime min="2021" value={time} onIonChange={(e) => updateTime(e.detail.value)}/>
              </IonItem>
            </IonCol>
          </IonRow>
        </IonGrid>
      </IonContent>
    </IonPage>
    );
};

export default Calendar;
